import React from "react";
import './Items.css'
import ItemSub1 from "./ItemSub1";
import ItemSub2 from "./ItemSub2";
import ItemSub3 from "./ItemSub3";

function Items() {
  return (
    <>
      <p className="menuHeading">Today's Menu</p>
      <ItemSub1></ItemSub1>
      <ItemSub2></ItemSub2>
      <ItemSub3></ItemSub3>
    </>
  );
}

export default Items;
